  const saveExpneseDataHandler = (enteredExpenseData) => {
    const expenseData = {
      ...enteredExpenseData,
      id: Math.random().toString(),
    };
  };
  return (
    <div className="new-expense">
      <ExpenseForm onSaveExpenseData></ExpenseForm>
